INSERT INTO `artikel` (`id_artikel`, `judul_artikel`, `isi_artikel`, `penulis_artikel`, `kategori_artikel`, `gambar_artikel`, `sumber_artikel`, `insert_on`, `update_on`) VALUES
(1, 'Iguana', 'Iguana adalah marga kadal yang hidup di daerah tropis Amerika Tengah, Amerika Selatan, dan kepulauan Karibia. Kadal-kadal ini dideskripsikan pertama kali oleh seorang ahli hewan berkebangsaan Austria, Josephus Nicolaus Laurenti pada tahun 1768. Sejauh ini, genus Iguana hanya terdiri dari dua spesies, yaitu iguana hijau (Iguana iguana) dan iguana Antilles Kecil (Iguana delicatissima).\r\n\r\nIstilah "iguana" diketahui kemungkinan berasal dari bahasa Taino (salah satu suku asli Amerika) yaitu "iwana" yang juga merujuk pada kadal-kadal ini.\r\n\r\nPanjang tubuh iguana antara 1.5 meter hingga 1.8 meter, termasuk panjang ekor. Ciri khas dari iguana adalah memiliki jambul (seperti pada ayam jantan) di bawah rahang mereka, serta deretan sisik membentuk duri besar di tubuh bagian atasnya, yang berjejer dari leher hingga pangkal ekor. Selain itu, iguana juga memiliki organ tubuh mirip mata pada bagian atas kepalanya. Organ tersebut berfungsi untuk menganalisis cahaya di sekitarnya. Warna tubuh iguana bervariasi, mulai dari hijau terang, hijau kecokelatan, hijau lumut, hijau kekuningan atau keabu-abuan, atau cokelat karamel. Ekor iguana berwarna sama dengan tubuh dan dihiasi dengan belang belang hitam atau gelap dari pangkal hingga ujung.\r\n\r\nIguana telah beradaptasi dengan baik sebagai kadal pohon dan kadal pemakan tumbuhan (herbivora). Akan tetapi, mereka tetap memerlukan nutrisi hewani, biasanya dengan memakan serangga kecil yang ada di tumbuhan yang mereka makan.', 'admin', 'Pengetahuan', '796px-St_Thomas_Marriott_Iguana_9_cropped3.jpg', 'https://id.wikipedia.org/wiki/Iguana', '2019-03-13 05:21:04', '2019-03-13 05:21:04'),
(2, 'Tarantula', '', 'coba', 'Pengetahuan', 'Jellyfish1.jpg', 'https://id.wikipedia.org/wiki/Tarantula', '2019-03-15 03:36:31', '2019-03-15 03:20:46');
